import React from 'react'

const ContactFooter = (props) => {
  return (
    <a href= {props.cont[1]} className>
        <div className='website__footer-contact-subelements shadow-drop-2-center'>
            <h2>{props.cont[0]}</h2>
            <p>{props.cont[2]}</p>
        </div>
    </a>
  )
}

export default ContactFooter
